const Project = () => {
    return(
        <StyledProject>

           <section id="portfolio" className="project">
      <div className="container">
        {/* ... */}
        <div className="row">
          <div className="col-md-4 mb-3 pt-4">
            <Card
              imageSrc="img/1.png"
              title="Simple CV"
              description="This is a simple exercise to create a CV using Html and Css."
              link="https://github.com/annisam23/miniProject/tree/main/Portofolio%20Boostrap%205"
            />
          </div>
          {/* Add more Card components for other projects */}
        </div>
      </div>
    </section>
        </StyledProject>
    )
}
export default Project;
